import ClickThrottle from "./Components/ClickThrottle";
export default function App() {
  return (
    <div className="App">
      <ClickMe />
      <ClickMe2 />
      <ClickMe3 />
      <Timer />
      <ClickThrottle />
    </div>
  );
}
